import React from "react";
import Card from "./card";

function Stuff(){
    return(<div>
    <Card url="https://giphy.com/embed/62tGXpMH900jbKnyUK" alignm={left} key={1} name="My Projects"/>
    <Card url="https://giphy.com/embed/kFd76qcrqQK6qefgXK" alignm={right} key={2} name="My Blogs"/>
    </div>)
}
export default Stuff;
